  'EROS RODRIGUES', 'DANILO ANDRADE', 'ANSELMO CUNHA', 'FERNANDA TAVARES'
];

export const TIPOS_TELHAS = ['SANDUICHE', 'SIMPLES', 'FORRO'];

export const TIPOS_EPS = ['TP40', 'TP25', 'FORRO', '30MM', '50MM', 'PIR30MM', 'PIR50MM'];

export const TIPOS_FRETE = ['CIF', 'FOB'];

export const DEFAULT_METROS_POR_HORA = {
